import React, {useEffect, useState} from 'react';
import { Row, Image, Col } from "react-bootstrap";
import { Api } from "../../services/connection";
import profile from '../../assets/images/weliton-profile.jpg'

import './home.css';

const Home = () => {
	const [data, setData] = useState(undefined);

	const getData = async () =>{
		try{
			const res = await Api.get('/profile');
			setData(res.data);
			console.log(data.data.formation);		
		}catch(e){}
	}

	useEffect(() => {
    getData();
  }, []);

	return (
		data ?
		<div>
			<Row>
				<Col xs={6} md={4} className="content-image-profile">
					<div>
						<Image src={profile} roundedCircle className="profile-image"/>
						<div className="left">

						</div>
					</div>
				</Col>
				<Col xs={6} md={7}>
					<h4>Sobre:</h4>
					{data.data.about.map((e) => <div key={`${e}`}>{e}</div>)}

					<br/>
					<h4>Soft skills:</h4>
					{data.data.softSkills.map((e) => <div key={`${e}`}>{e}</div>)}

					<br/>
					<h4>Hard skills:</h4>
					{data.data.hardSkills.map((e) => (
						<div>
							<h6 key={`${e.title}`} style={{backgroundColor: 'khaki'}}>{e.title}: </h6>
							<div className="row">
								{e.itens.map((item) => <p key={`${Date().getMilliseconds()}`}>&emsp;{item}</p>)}
							</div>
						</div>
					))}

					<br/>
					<h4>Formação:</h4>
					{data.data.formation.map((e) => <div key={`${e}`}>{e}</div>)}
				</Col>
			</Row>
		</div> : <div/>
	)
}

export {Home};
